    false,nt"url": null,nt"notes": "The City of Austin through the Capital
    Area Council of Governments (CAPCOG) contracted Aerial Survey, Inc. to create the
    City of Austin's planimetric database. The planimetrics were created from imagery
    acquired in Spring 2003 using photogrammetric techniques. This particular layer
    represents contour elevation lines as of Spring 2003. Full metadata: ftp://ftp.ci.austin.tx.us/GIS-Data/Regional/planimetrics/contour.htm
    Note: These files are named and clipped by USGS 1:24,000 quads. Index map: ftp://ftp.ci.austin.tx.us/GIS-Data/Regional/contours/index.pdf
    This product is for informational purposes and may not have been prepared for or
    be suitable for legal, engineering, or surveying purposes. It does not represent
    an on-the-ground survey and represents only the approximate relative location of
    property boundaries. This product has been produced by the Communications and Technology
    Department for the sole purpose of geographic reference. No warranty is made by
